   "source": [
    "# **Case study: How does a Bike-Share Navigate Speedy Success 2023?**\n",
    "Raul Carranza\n",
    "8/4/2023\n",
    "\n",
    "\n",
    "This data analysis for my capstone was done for my Google Data Analytics Certification project. The data I will be using spans a 12 month period from July 2022 to June 2023.The data used has been made available by Motivate International Inc. and can be accessed here <https://divvy-tripdata.s3.amazonaws.com/index.html>. This data helps identify possible trends from annual customers that could help motivate casual riders. A problem I ran into was that the files were too big. How I overcame this was I split the data into smaller bits in order to upload the files into a large excel file. This proved to be tedious so I pivoted to using R Programming to get a better understanding of my data and eliminate as much user error as possible.  This analysis is based on the Divvy case study \"'Sophisticated, Clear, and Polished’: Divvy and Data Visualization\" written by Kevin Hartman (found here: https://artscience.blog/home/divvy-dataviz-case-study ).\n",
    "\n",
    "**Business Task:**\n",
    "Analyze usage patterns of annual members and casual riders of Cyclistic bikes to inform business decisions and improve customer experience, retention, and bike-sharing service optimization.\n",
    "Insights from this analysis will help Cyclistic:\n",
    "Tailor marketing strategies, pricing plans, and service offerings to meet the specific needs of each user group.\n",
    "Identify areas of improvement to attract more customers and convert casual riders into annual members.\n",
    "\n",
    "\n"
   ]
  },
