    "setwd('/kaggle/working/') #sets your working directory to simplify calls to data \n",
    "\n",
    "# Define a function to install and load packages\n",
    "install_and_load <- function(package_name) {\n",
    "  if (!require(package_name, character.only = TRUE)) {\n",
    "    install.packages(package_name)\n",
    "  }\n",
    "  library(package_name, character.only = TRUE)\n",
    "}\n",
    "\n",
    "# Install and load necessary packages\n",
    "packages_to_install <- c(\"tidyverse\", \"dplyr\", \"lubridate\", \"janitor\")\n",
    "\n",
    "# Using the function to install and load each package\n",
    "invisible(sapply(packages_to_install, install_and_load))\n"
   ]
