   "source": [
    "# Assuming tripdata is the data frame containing trip information\n",
    "# and it has columns named \"member_casual\" and \"date\".\n",
    "\n",
    "# Load necessary packages\n",
    "library(dplyr)\n",
    "\n",
    "# Step 1: Filter data for trips between 07/22 and 06/23\n",
    "filtered_tripdata <- tripdata %>%\n",
    "  filter(date >= as.Date(\"2022-07-22\") & date <= as.Date(\"2023-06-23\"))\n",
    "\n",
    "# Step 2: Calculate the total number of trips for each rider type\n",
    "total_trips_by_type <- filtered_tripdata %>%\n",
    "  group_by(member_casual) %>%\n",
    "  summarize(total_trips = n())\n",
    "\n",
    "# Step 3: Calculate the percentage of each rider type out of the total trips\n",
    "total_trips <- sum(total_trips_by_type$total_trips)\n",
    "percentage_members <- (total_trips_by_type$total_trips[total_trips_by_type$member_casual == \"member\"] / total_trips) * 100\n",
    "percentage_casual <- (total_trips_by_type$total_trips[total_trips_by_type$member_casual == \"casual\"] / total_trips) * 100\n",
    "\n",
    "# Display the results\n",
    "cat(\"Out of the total trips taken from 07/22-06/23:\\n\")\n",
    "cat(\"Members made up a total of\", round(percentage_members, 2), \"%\\n\")\n",
    "cat(\"Casual riders made up only\", round(percentage_casual, 2), \"%\\n\")\n"
   ]
  },
